'use strict';

// Libs
import React          from 'react';
import ReactDOM       from 'react-dom';
import {
  createStore,
  applyMiddleware,
  compose
}                     from 'redux';
import {
  Provider
}                     from 'react-redux';
import {
  browserHistory
}                     from 'react-router';
import {
  syncHistoryWithStore
}                     from 'react-router-redux'

// Components
import {
  Router,
  Route
}                     from 'react-router';
import TodoApp        from './modules/todos/TodoApp.component';
import MainApp,
{
  HomePage,
  NotFound
}                     from './modules/main/MainApp.component';

// Reducer
import {
  rootReducer,
  initialState
}                     from './reducer';

const devTool  = window.devToolsExtension && window.devToolsExtension();
const store    = createStore(rootReducer, initialState, devTool);
const history  = syncHistoryWithStore(browserHistory, store);

ReactDOM.render(
  <Provider store={store}>
    <Router history={history}>
      <Route component={MainApp}>
        <Route path="/" component={HomePage}/>
        <Route path="todo" component={TodoApp}/>
      </Route>
      <Route path="*" component={NotFound}/>
    </Router>
  </Provider>,
  document.getElementById('app')
);

'use strict';

import './MainApp.scss';

import React  from 'react';
import {
  Link
}             from 'react-router';

/**
 * Generate site navigation
 * @return {ReactElement} <nav/> Markup
 */
export const Menu = () => (
  <nav className="appMenu">
    <Link className="appMenu_item" activeClassName={'appMenu_item-active'} to="/">Home</Link>
    <Link className="appMenu_item" activeClassName={'appMenu_item-active'} to="todo">Todo</Link>
  </nav>
);

/**
 * Temporary home page
 * @return {ReactElement} <div class="homePage"/> Markup
 */
export const HomePage = () => (
  <div className="homePage">
    <h1>Hello Redux!</h1>
  </div>
);

/**
 * Error 404 fallback page
 * @return {ReactElement} <div class="notFound"/> Markup
 */
export const NotFound = () => (
  <div className="notFound">
    <h1>Error 404 : Page Not Found</h1>
  </div>
);

/**
 * Main wrapper
 * @params {ReactElement} children - all components called from router
 * @return {ReactElement} <div class="notFound"/> Markup
 */
const MainApp = ({
  children
}) => (
  <div class="mainApp">
    <Menu/>
    {children}
  </div>
);

export default MainApp;

'use strict';

// Styles
import './TodoApp.scss';

// Dependencies
import React          from 'react';
import { connect }    from 'react-redux';
import classNames     from 'classnames';

import {
  addTodo,
  removeTodo,
  toggleTodo,
  clearTodo
}                     from './reducers/todos.reducer';
import {
  todoFilters,
  setTodoFilter,
  getFilteredTodos
}                     from './reducers/todoFilter.reducer';

// Presentational Components
export const Todo = (
  { completed, label, onClick, onButtonClick }
) => (
  <li className={`todoList_item todoList_item-${completed ? 'completed' : 'pending'}`}>
    <span className="todoList_itemLabel"
          onClick={onClick}>{label}</span>
    <button className="todoList_itemButton"
            onClick={onButtonClick}>+</button>
  </li>
);

export const TodoList = (
  { filteredTodos, onTodoClick, onTodoButtonClick }
) => (
  <ul className="todoList">
    {
      filteredTodos.map(todo =>
        <Todo key={todo.id}
              {...todo}
              onClick={() => onTodoClick(todo.id)}
              onButtonClick={() => onTodoButtonClick(todo.id)}/>
      )
    }
  </ul>
);

export const TodoForm = (
  { onTodoFormSubmit }
) => {
  let _label;

  return (
    <form className="todoForm"
          onSubmit={(e) => {
            e.preventDefault();
            _label.value.trim() && onTodoFormSubmit(_label.value.trim());
            _label.value = '';
          }}>
      <input className="todoForm_label"
             type="text"
             placeholder="What's need to be done today ?"
             ref={input => _label = input}/>
      <button className="todoForm_submit">add</button>
    </form>
  )
};

export const FilterLink = (
  { active, filter, onClick }
) => (
  <a className={classNames('filterList_item', { 'filterList_item-active' : active})}
     href={`#${filter}`}
     onClick={e => {
       e.preventDefault();
       !active && onClick(filter);
     }}>{filter.replace(/SHOW_/, '')}</a>
);

export const TodoFilterLinks = (
  { filterList, currentFilter, onLinkClick }
) => (
  <div className="filterList">
    <span class="filterList_label">see:</span>
    {
      filterList.map((filter, index) => (
        <FilterLink key={index}
                    filter={filter}
                    active={filter === currentFilter}
                    onClick={onLinkClick}/>
      ))
    }
  </div>
);

export const TodoFooter = (
  { todos, onTodoClearClick }
) => {
  let completed = todos.filter(todo => todo.completed).length,
    total       = todos.length,
    text        = total ? (total === completed ? 'all done, good job!' : `${completed}/${total} done`) : 'no todo yet';

  return (
    <p className="todoFooter">
      <span className="todoFooter_count">{text}</span>
      <a className={classNames('todoFooter_clear', { 'todoFooter_clear-hide' : !completed })}
         onClick={(e) => {
           e.preventDefault();
           completed && onTodoClearClick();
         }}>clear completed</a>
    </p>
  );
};

// Container Components
export const TodoApp = ({
  todos,
  filter,
  filterList,
  onTodoFormSubmit,
  onTodoClick,
  onTodoButtonClick,
  onTodoClearClick,
  onLinkClick
}) => (
  <section className="todoApp">
    <TodoForm onTodoFormSubmit={onTodoFormSubmit}/>
    <TodoFilterLinks filterList={filterList}
                     currentFilter={filter}
                     onLinkClick={onLinkClick}/>
    <TodoList filteredTodos={getFilteredTodos(todos, filter)}
              onTodoClick={onTodoClick}
              onTodoButtonClick={onTodoButtonClick}/>
    <TodoFooter todos={todos} onTodoClearClick={onTodoClearClick}/>
  </section>
);

const MapStateToProps = ( state ) => {
  return {
    todos         : state.todos,
    filter        : state.todoFilter,
    filterList    : Object.keys(todoFilters)
  };
};

const MapDispatchToProps = ( dispatch ) => {
  return {
    onTodoFormSubmit  : label => dispatch(addTodo(label)),
    onTodoClick       : id => dispatch(toggleTodo(id)),
    onTodoButtonClick : id => dispatch(removeTodo(id)),
    onTodoClearClick  : () => dispatch(clearTodo()),
    onLinkClick       : filter => dispatch(setTodoFilter(filter))
  };
};

export default connect(
  MapStateToProps,
  MapDispatchToProps
)(TodoApp);

'use strict';

// Constants
export const SET_TODO_FILTER = 'SET_TODO_FILTER';
export const todoFilters = {
  SHOW_ALL        : 'SHOW_ALL',
  SHOW_COMPLETED  : 'SHOW_COMPLETED',
  SHOW_PENDING    : 'SHOW_PENDING'
};

// Actions
export const setTodoFilter = ( filter ) => {
  return { type : SET_TODO_FILTER, filter };
};

export const getFilteredTodos = ( todos = [], filter = todoFilters.SHOW_ALL ) => {
  switch ( filter ) {
    case todoFilters.SHOW_PENDING:
      return todos.filter(todo => !todo.completed);
    case todoFilters.SHOW_COMPLETED:
      return todos.filter(todo => todo.completed);
    default:
      return todos;
  }
};

// Reducer
const todoFilter = ( state = 'SHOW_ALL', action ) => {
  switch ( action.type ) {
    case SET_TODO_FILTER:
      return action.filter in todoFilters ? action.filter : state;
    default:
      return state;
  }
};

export default todoFilter;

'use strict';

// Constants
export const ADD_TODO     = 'ADD_TODO';
export const REMOVE_TODO  = 'REMOVE_TODO';
export const TOGGLE_TODO  = 'TOGGLE_TODO';
export const CLEAR_TODO   = 'CLEAR_TODO';

// Actions
export const addTodo = ( label ) => {
  return { type : ADD_TODO, label };
};

export const removeTodo = ( id ) => {
  return { type : REMOVE_TODO, id };
};

export const toggleTodo = ( id ) => {
  return { type : TOGGLE_TODO, id };
};

export const clearTodo = () => {
  return { type : CLEAR_TODO };
};

// Reducer
const todos = ( state = [], action ) => {
  switch ( action.type ) {
    case ADD_TODO:
      return state.concat(
        {
          id        : state.reduce((maxId, todo) => Math.max(todo.id, maxId), -1) + 1,
          label     : action.label,
          completed : false
        }
      );
    case REMOVE_TODO:
      return state.filter(todo => todo.id !== action.id);
    case TOGGLE_TODO:
      return state.map(todo => {
        return action.id === todo.id ? Object.assign({}, todo, { completed : !todo.completed}) : todo;
      });
    case CLEAR_TODO:
      return state.filter(todo => !todo.completed);
    default:
      return state;
  }
};

export default todos;

'use strict';

// Dependencies
import { combineReducers }  from 'redux';

// Reducers
import {
  routerReducer
}                           from 'react-router-redux';
import todos                from './modules/todos/reducers/todos.reducer';
import todoFilter           from './modules/todos/reducers/todoFilter.reducer';

export const initialState = {
  routing     : { locationBeforeTransitions : null },
  todos       : [],
  todoFilter  : 'SHOW_ALL'
};

export const rootReducer = combineReducers({
  routing : routerReducer,
  todos,
  todoFilter
});
